import React from 'react';

function AboutPage() {
    return (
        <div className="about-page">
            <p>
                The grade distributions are given by the University of California, Santa Cruz for the following quarters: Winter 2023,
                Spring 2023, Summer 2023, Fall 2023, and Winter 2024. Every class is unique up to year, quarter, class name, professor,
                and class time. The total cost of acquiring these records was $406.
            </p>
            <p>
                Pursuant to the federal Family Education Rights and Privacy Act (FERPA), certain records may be
                excluded. This website is not affiliated with or endorsed by UC Santa Cruz.
            </p>
        </div>
    )
}

export default AboutPage;
